column8:
メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
【aircornoleda08】AIRCORNO エアコルノLED電球A08<br>
<br>
E26口金で一般的なソケットにピッタリのサイズ。<br>
消費電力約8Wと省エネなのに電球の明るさは白熱電球約60W相当で節電対策。<br>
SAMSUNG製高性能LEDチップ採用。<br>
密閉器具対応、光色は暖かな電球色と清涼感のある昼光色の２色。<br>
<br>
【特徴】<br>
・消費電力8Wの省エネで長寿命なLED電球。<br>
・E26口金で一般的なソケットにピッタリ。<br>
・明るさは白熱電球60W相当。<br>
・密閉器具対応。<br>
・SAMSUNG製高性能LEDチップ採用。<br>
・光色は電球色(3000k/810lm)昼光色(6500k/890lm)。<br>
・演色指数80以上で高演色<br>
・高効率110lm/w<br>
・広配光、約200度<br>
<br>
AIRCORNOシリーズから省エネ・長寿命のLED電球が発売。<br>
密閉器具対応でバスルームの照明など、カバーで覆われてる箇所にも設置可能。<br>
演色指数は80以上と高演色。LEDチップにSAMSUNG製高性能チップ「5630」を使用。<br>
発光色が美しく最強のコストパフォーマンスを誇っている人気のチップです。<br>
E26口金対応で一般電球と交換可能。<br>
配光角はワイドな約200度で広く明るく照らします。<br>
間接照明の電球にもオススメです。<br>
<br>
【仕様】<br>
■種別：A60<br>
■消費電力：約8W<br>
■口金：E26<br>
■サイズ：約H110×Φ60mm<br>
■重さ：約60g<br>
■配光角：約200度<br>
■明るさ：約810lm(電球色)/約890lm(昼光色)<br>
■光色：電球色(3000k)/昼光色(6500k)<br>
■平均演色評価数：Ra80<br>
■屋内用:100V 50/60Hz<br>
<br>
【使用できない環境】<br>
※誘導灯・非常用照明器具、HIDランプ器具では絶対に使用しないでください。<br>
※周囲温度が40℃を超える場所では使用しないでください<br>
※水滴がかかる場所では使用しないでください。<br>
※硫黄成分を含む温泉地や工場、酸などの腐食性ガス発生のある環境、塩害をうける環境では使用できません。<br>
<br>
【使用できない器具】<br>
※調光・調色機能付き器具<br>
※ホタルスイッチ<br>
　(消灯時にスイッチが光るもの/電球が薄く光ったままの状態になる場合があります。)<br>
※電球と反射板の隙間が近い器具<br>
※センサー付きの器具<br>
※断熱施工器具（SB、SGI、SG形表示器具など）<br>
※直流電源<br>
※電子点滅器には使用しないでください。<br>
※次のような調光器と組み合わせて使用しないでください。<br>
■人感センサ付調光器　■リモコン式調光器<br>
■段調光形調光器　■定格1000W以上の調光器<br>
■記憶式調光器　■電球用以外の調光<br>
<br>
◆注意事項◆<br>
※電球を長時間直視するのはおやめください。<br>
※ラジオやテレビなどの音響および映像機器の近くで点灯しますと雑音が入る場合があります。<br>
※寸法、熱的、その他の状況（リモコン機能のついた器具など）により使用できない場合があります。<br>
※器具の種類によっては、ちらつく場合があります。<br>
※LED素子にはバラツキがあるため、同じ商品でも光色や明るさが異なることがあります。<br>
※明るさ、光の広がり方は電球と異なります。<br>
※取付・取り外しは必ず電源を切った状態で行い、電源を入れた状態や電源を切った後しばらくの間は、電球が熱いので触れないでください。感電、やけどの原因となります。 <br>
