壁スイッチの切り替えで、電球色-白色-昼光色に調色可能<br>
また、電球色モードの時は100%-65%-35%-10%の調光ができます。<br><br>
お手持ちの器具に入れてお好みの色・明るさが楽しめます。<br>
810ルーメンで一般電球60W相当。汎用性の高いE26口金です。<br><br>

【仕様】<br>
LED電球 一般電球形<br>
口金：E26 <br>
サイズ：φ60mmｘ110mm<br>
消費電力：9W<br>
定格電圧(周波数)：AC80-120V（50/60Hz)<br>
色温度：3000-6500K<br>
全光束：最大810m(※一般電球60W相当)<br>
照射角度：210° 高配光タイプ<br>
重量：63.6g<br>  
高品質、省エネ<br>
※1年間製品保証<br>
定格寿命40,000時間以上<br><br>
※調光器非対応<br><br>

【使用方法】<br><br>
■調光・調色の設定<br>
スイッチオンで点灯<br>
↓
2秒以上経過後、スイッチをオフ<br>
1秒以内にオン<br>
↓<br>
循環モード（６段階）に入ります<br>
↓<br>
希望のモードでスイッチオフ<br>
1秒以内にオン<br>
↓<br>
希望のモードで点灯します<br>
